CREATE TABLE `schema_migrations` (`version` varchar(255) NOT NULL);
CREATE TABLE `flights` (`id` INTEGER PRIMARY KEY auto_increment NOT NULL, `origin` varchar(255), `destination` varchar(255), `depart_date` date, `return_date` date, `created_at` datetime, `updated_at` datetime, `departure_airport_id` integer, `arrival_airport_id` integer);
CREATE TABLE `airports` (`id` INTEGER PRIMARY KEY auto_increment NOT NULL, `code` varchar(255), `name` varchar(255), `city` varchar(255), `country` varchar(255), `created_at` datetime, `updated_at` datetime, `lat` float, `lng` float);
CREATE UNIQUE INDEX `unique_schema_migrations` ON `schema_migrations` (`version`);
